import React, { Component } from 'react';

//TODO: also needs to pass the user information.

class PropertyPage extends Component {
	constructor() {
		super();
		this.state = {
			property: {},
			reviews: [
				{
					id: 1,
					username: 'Dummy 1',
					date: 'Febuary 2020',
					comment:
						'This is a pretty gucci property'
				},
				{
					id: 2,
					username: 'Dummy 2',
					date: 'March 2020',
					comment:
						'This is a pretty not gucci property'
				}
			],

			room: {
				numGuest: 1,
				numBedroom: 1,
				numBed: 1,
				numBath: 1
			}
		};
	}

	componentDidMount() {
		this.setState({
			property: this.props.property
		});
	}

	render() {
		const { property, room } = this.props;
		return (
			<div>
				<div className='roomContainer'>
					<p>{`${room.numGuest} guests`}</p>
					<p>{`${room.numBedroom} bedroom`}</p>
					<p>{`${room.bed} bed`}</p>
					<p>{`${room.Bath} bathroom`}</p>
				</div>
				<h3> {property.location} </h3>
				<h2> {property.title} </h2>
				<p> {`$${property.price} CAD/night`}</p>
				<p>{this.props.propertyID}</p>
			</div>
		);
	}
}

export default PropertyPage;
